import React, {Component} from 'react'

import '../checkbox.css'

class Checkbox extends Component {
    constructor(props){
        super(props)
    }
    render(){
        return (
            <span onClick={this.props.toggleCheck} onChange={this.props.onCheck}>
                <input type="checkbox" {...this.props}></input>
                <span></span>
            </span>
        )
    }
}

export default Checkbox
